          <h2><span style={STYLE.NAPS}>We couldn't find that page!</span> </h2>
          <div className="homeText:hover">
          <h2>home</h2>
          </div>
        </div>

      {/* DO NOT REMOVE THIS DIV COMPONENT*/}</div>
      )
  }
}
export default Error
